import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import "./index.css"; // Import your global styles if any

function App() {
    return (
        <div>
            <Routes>
                <Route path="/" element={<Home />} />
            </Routes>
        </div>
    );
}

export default App;
